def calm(hexn, i):
    k = 1
    while True:
        if hexn[i+1-7*k:i+1:k] in de.keys():

            for l in range(420 + 1 - 56 * k, 420 + 1, 7 * k):
                print(de[hexn[l:l + 7 * k:k]])
            return k
        k += 1
    print(hexn[l:l + 7 * k:k])



de = {'0001101': 0, '0011001': 1, '0010011': 2, '0111101': 3, '0100011': 4, '0110001': 5, '0101111': 6, '0111011': 7,
      '0110111': 8, '0001011': 9}
calm('', 253)
